import React from 'react'
import Rateimge from '../../images/rate.png'
const RateItem = () => {
    return (
        <div className=''>
            <div className='title-post'>
                <span> Mahmoud Toma</span>
                <span className='rate-product-rate'><img src={Rateimge}/> 4.3</span>
            </div>
        </div>
    )
}

export default RateItem
